import React, { useState } from "react";
import TextField from '@mui/material/TextField';
import DatePicker from '@mui/lab/DatePicker';
import { Grid } from "@mui/material";

function SearchConcert() {
    const [date, setDate] = useState(null);
  return (
    <div>
        <Grid container spacing={0} align="center" justify="center" direction="column">
            <Grid item style={{ backgroundColor: 'yellow' }}>
            <h2>This grid item is centered both horizontally and vertically.</h2>
            <i>
                <p>
                Note the styling of body, html and #root in index.css for this to
                work.
                </p>
                <p>
                Thanks to <a href="https://codesandbox.io/s/gLE85V2D">STUNAZ</a> for
                improving upon my original!
                </p>
            </i>
            </Grid>
        </Grid>
        <Grid container spacing={1} justifyContent="center">
            <Grid item sm={3}></Grid>
            <Grid item sm={2}>
                <TextField id="outlined-basic" label="Artist Name" variant="outlined" />
            </Grid>
            <Grid item sm={2}>
                <TextField id="outlined-basic" label="City" variant="outlined" />
            </Grid>
            <Grid item sm={2}>
                <DatePicker
                    label="Concert Date"
                    value={date}
                    onChange={(newDate) => {
                        setDate(newDate);
                    }}
                    renderInput={(params) => <TextField {...params} />}
                />
            </Grid>
            <Grid item sm={3}></Grid>
        </Grid>
    </div>
  );
}

export default SearchConcert;
